matplotlib.lib.matplotlib.axes._base.get:
def get_subplotspec(self):
    """Return the `.SubplotSpec` associated with the subplot, or None."""
    return self._subplotspec

matplotlib.lib.matplotlib.colorbar.get_s:
def get_subplotspec(self):
    # make tight_layout happy..
    return (
        self._cbar.ax.get_subplotspec()
        or getattr(self._orig_locator, "get_subplotspec", lambda: None)())

matplotlib.lib.matplotlib.gridspec.get_t:
def get_topmost_subplotspec(self):
    """
    Return the topmost `SubplotSpec` instance associated with the subplot.
    """
    gridspec = self.get_gridspec()
    if hasattr(gridspec, "get_topmost_subplotspec"):
        return gridspec.get_topmost_subplotspec()
    else:
        return self
